var CookiebotDialog, CookieConsentDialog; CookiebotDialog = CookieConsentDialog = new CookieControl.Dialog(CookieConsent, 'slideup_customcolor', 'Informationen &#252;ber Cookies auf dieser Website', '<p style="">HOFER REISEN verwendet Cookies &amp; Plugins, um die Website bestm&ouml;glich an Ihre Bed&uuml;rfnisse anpassen zu k&ouml;nnen. Cookies &amp; Plugins erm&ouml;glichen die Verwendung bestimmter Features, das Teilen auf sozialen Netzwerken (Facebook, Instagram etc.) und das Anpassen von Nachrichten und Werbeanzeigen an Ihre pers&ouml;nlichen Interessen. Einige davon sind unerl&auml;sslich f&uuml;r grundlegende Funktionsweisen.</p><p style=""></p><p style="">Mit Klick auf Akzeptieren stimmen Sie der Verwendung der Cookies &amp; Plugins auf unseren Webseiten zu.<br style="" /></p>', 'Akzeptieren', 'Ablehnen', 'optinout', false, false, 'strict', 'de', '<p style="">Cookies sind kleine Textdateien, die von Webseiten verwendet werden, um die Benutzererfahrung effizienter zu gestalten. Sie erm&ouml;glichen eine Wiedererkennung Ihres Computers, die Dateien sind jedoch keiner bestimmten Person zugeordnet.</p><p style=""></p><p style="">Laut Gesetz k&ouml;nnen wir Cookies auf Ihrem Ger&auml;t speichern, wenn diese f&uuml;r den Betrieb dieser Seite unbedingt notwendig sind. F&uuml;r alle anderen Cookie-Typen ben&ouml;tigen wir Ihre Erlaubnis. <br style="" /><br style="" />Diese Seite verwendet unterschiedliche Cookie-Typen. Einige unserer Cookies sind unbedingt notwendig, um unsere Websites oder bestimmte Funktionalit&auml;ten derselben zu verwenden. Diese funktionalen Cookies k&ouml;nnen beim Verwenden unserer Websites nicht abgelehnt werden. Die meisten der verwendeten Cookies sind sogenannte "Session-Cookies", die ausschlie&szlig;lich f&uuml;r die Dauer Ihrer Nutzung unserer Internetseiten zwischengespeichert werden. Wir verwenden auch Analyse-Cookies, um die Performance unserer Websites zu verbessern.&nbsp; <br style="" /><br style="" />Weitere Informationen entnehmen Sie bitte unseren Datenschutzbestimmungen auf der Website.</p>', 'Notwendige Cookies helfen dabei, eine Webseite nutzbar zu machen, indem sie Grundfunktionen wie Seitennavigation und Zugriff auf sichere Bereiche der Webseite erm&ouml;glichen. Die Webseite kann ohne diese Cookies nicht richtig funktionieren. ', 'Pr&auml;ferenz-Cookies erm&ouml;glichen einer Webseite sich an Informationen zu erinnern, die die Art beeinflussen, wie sich eine Webseite verh&auml;lt oder aussieht, wie z. B. Ihre bevorzugte Sprache oder die Region in der Sie sich befinden. ', 'Statistik-Cookies helfen Webseiten-Besitzern zu verstehen, wie Besucher mit Webseiten interagieren, indem Informationen anonym gesammelt und gemeldet werden. ', 'Marketing-Cookies werden verwendet, um Besuchern auf Webseiten zu folgen. Die Absicht ist, Anzeigen und Informationen zu zeigen, die relevant und ansprechend f&uuml;r den einzelnen Benutzer sind. ', 'Nicht klassifizierte Cookies sind Cookies, die wir gerade versuchen zu klassifizieren, zusammen mit Anbietern von individuellen Cookies. ');
